import React from "react";
import create from "zustand";

const useFishStore = create((set) => ({
  fishies: {},
  fetch: async (pond) => {
    const response = await fetch(pond);
    set({ fishies: await response.json() });
    console.log(fishies);
  },
}));

export default useFishStore;
